void end_screen(volatile int *pixel_ctrl_ptr ,int colour){
    
    if(colour==2)
    {
    int i = 0, j = 0, W = 320, H = 240;
    
    for(int k = 0; k < W*H*2 - 1; k += 2){
        int red = ((end_screen_yellow[k + 1] & 0xF8) >> 3) << 11;
        int green  = (((end_screen_yellow[k] & 0xE0) >> 5)) | ((end_screen_yellow[k+1] & 0x7) << 3) ;
        int blue = (end_screen_yellow[k] & 0x1f);
        
        short int p = red | ( (green << 5) | blue);
        
        plot_pixel( 0 + i, j, p);
        
        i += 1;
        
        if (i == W) {
            i = 0;
            j += 1;
        }
    }
    
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    }
    else
    {
        int i = 0, j = 0, W = 320, H = 240;
        
        for(int k = 0; k < W*H*2 - 1; k += 2){
            int red = ((end_screen_red[k + 1] & 0xF8) >> 3) << 11;
            int green  = (((end_screen_red[k] & 0xE0) >> 5)) | ((end_screen_red[k+1] & 0x7) << 3) ;
            int blue = (end_screen_red[k] & 0x1f);
            
            short int p = red | ( (green << 5) | blue);
            
            plot_pixel( 0 + i, j, p);
            
            i += 1;
            
            if (i == W) {
                i = 0;
                j += 1;
            }
        }
        
        /* set back pixel buffer to start of SDRAM memory */
        *(pixel_ctrl_ptr + 1) = 0xC0000000;
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    }
    
}
void clear_screen() {
    int x = 0;
    int y = 0;
    
    //draw black everywhere
    for(x = 0; x < 320; x++){
        for(y = 0; y < 200; y++){
            plot_pixel(x, y, 0xFFFF);
        }
    }
    
    for(x = 0; x < 320; x++){
        for(y = 200; y < 240; y++){
            plot_pixel(x, y, 0x5061);
        }
    }
}

void draw_line(int x0, int y0, int x1, int y1, short int color) {
    int is_steep = 0; //initialize to false
    int abs_y = y1 - y0;
    int abs_x = x1 - x0;
    
    if (abs_y < 0 ) abs_y =-abs_y; //change sign if negative
    if (abs_x < 0) abs_x = -abs_x;
    
    if (abs_y > abs_x) is_steep=1; //TRUE
    
    if (is_steep) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    
    if (x0>x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }
    
    int deltax = x1 - x0;
    int deltay = y1-y0;
    if (deltay <0) deltay = -deltay;
    int error = -(deltax / 2);
    int y = y0;
    int y_step;
    
    if (y0 < y1) y_step =1;
    else y_step = -1;
    
    for(int x=x0; x<=x1; x++) {
        if (is_steep) plot_pixel(y,x, color);
        else plot_pixel(x,y, color);
        
        error += deltay;
        
        if (error>=0) {
            y +=y_step;
            error -= deltax;
        }
    }
}


void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

